(window.webpackJsonp=window.webpackJsonp||[]).push([[39],{1160:function(s){s.exports={content:'<h3>\u5199\u5728\u6700\u524d</h3>\n<p>\u6700\u8fd1\u9879\u76ee\u6709\u4e2a\u9700\u6c42\uff0c\u83b7\u53d6\u51fd\u6570\u53c2\u6570\u540d\uff0c\u542c\u8d77\u6765\u5f88\u7b80\u5355\uff0c\u4f46\u6709\u4e86ES6\uff0c\u53c2\u6570\u548c\u51fd\u6570\u5199\u6cd5\u5343\u5947\u767e\u602a\uff0c\u5728github\u4e0a\u5927\u6982\u770b\u4e86\u51e0\u4e2a\u5e93\uff0c\u57fa\u672c\u4e0a\u90fd\u662f\u6b63\u5219\uff0c\n\u5bf9\u901a\u7528\u7684\u5199\u6cd5\u80fd\u591f\u8986\u76d6\uff0c\u7a0d\u5fae\u8d8a\u8fc7\u8fb9\u754c\uff0c\u5f80\u5f80\u65e0\u6cd5\u6b63\u786e\u5339\u914d\u3002</p>\n<p>\u4e8e\u662f\u5c31\u6709\u4e86\u4f7f\u7528<code>AST</code>\u53bb\u8fdb\u884c\u8986\u76d6\u67e5\u627e\u7684\u60f3\u6cd5\u3002</p>\n<h3>\u6982\u5ff5</h3>\n<p>\u62bd\u8c61\u8bed\u6cd5\u6811\uff08abstract syntax tree\u6216\u8005\u7f29\u5199\u4e3aAST\uff09\uff0c\u6216\u8005\u8bed\u6cd5\u6811\uff08syntax tree\uff09\uff0c\u662f\u6e90\u4ee3\u7801\u7684\u62bd\u8c61\u8bed\u6cd5\u7ed3\u6784\u7684\u6811\u72b6\u8868\u73b0\u5f62\u5f0f\u3002</p>\n<hr>\n<h3>\u4e3a\u4ec0\u4e48\u8981\u7528AST</h3>\n<p>\u901a\u8fc7AST\uff0c\u6211\u4eec\u53ef\u4ee5\u5bf9\u4ee3\u7801\u8fdb\u884c\u67e5\u627e\uff0c\u770b\u8d77\u6765\u597d\u50cf\u6b63\u5219\u8868\u8fbe\u5f0f\u4e5f\u53ef\u4ee5\u505a\u5230\uff0c\u90a3\u4e48\u4e3a\u4ec0\u4e48\u8981\u7528AST\u800c\u4e0d\u7528\u6b63\u5219\uff1f</p>\n<p>\u5c31\u8bf4\u4ece\u51fd\u6570\u83b7\u53d6\u53c2\u6570\u540d\uff0c\u5938\u5f20\u70b9\uff0c\u5982\u679c\u6709\u4ee5\u4e0b\u8868\u8fbe\u5f0f\uff1a</p>\n<pre class="hljs"><code><span class="hljs-function"><span class="hljs-keyword">function</span> <span class="hljs-title">x</span>(<span class="hljs-params">a=<span class="hljs-number">5</span>,b=<span class="hljs-string">"a"</span>,c=function(x=<span class="hljs-number">1</span>,y</span>)</span>{<span class="hljs-built_in">console</span>.log(x=<span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params">i=<span class="hljs-number">8</span>,j</span>)</span>{})},d={<span class="hljs-attr">x</span>:<span class="hljs-number">1</span>,<span class="hljs-attr">y</span>:<span class="hljs-number">2</span>,<span class="hljs-attr">z</span>:<span class="hljs-string">\'x=6\'</span>},e=<span class="hljs-function"><span class="hljs-params">x</span>=&gt;</span><span class="hljs-number">7</span>,f=[<span class="hljs-string">\'3=5\'</span>,<span class="hljs-string">\'x.1\'</span>,<span class="hljs-string">\'y,2\'</span>,<span class="hljs-number">1</span>],g=<span class="hljs-function">(<span class="hljs-params">x,y</span>)=&gt;</span>{<span class="hljs-keyword">let</span> z=<span class="hljs-function">(<span class="hljs-params">i,j=<span class="hljs-number">6</span></span>)=&gt;</span>{}},h){}\n</code></pre>\n<p><code>\u53c2\u6570\u662f[a,b,c,d,e,f,g,h]</code></p>\n<p>\u4f60\u786e\u5b9a\u8fd8\u60f3\u7528\u6b63\u5219\u53bb\u5339\u914d\u53c2\u6570\u540d\u79f0\u5417...</p>\n<blockquote>\n<p>AST\u662f\u4ece\u4ee3\u7801\u7684\u610f\u4e49\u53bb\u7f16\u8f91\uff0c\u800c\u6b63\u5219\u53ea\u80fd\u4ece\u4ee3\u7801\u7684\u5b57\u9762\u53bb\u7f16\u8f91\u3002</p>\n</blockquote>\n<p>\u4ee5\u4e0a\u5938\u5f20\u7684\u51fd\u6570\uff0c\u4f7f\u7528AST\u53bb\u5206\u6790\uff0c\u53ef\u4ee5\u5f88\u8f7b\u677e\u83b7\u53d6\u5b83\u7684\u53c2\u6570\u540d\u3002</p>\n<hr>\n<h3>Esprima</h3>\n<p>\u6211\u4eec\u4f7f\u7528<a href="http://esprima.org/demo/parse.html#">esprima</a>\uff0c\u4e00\u4e2a\u53ef\u4ee5\u5c06Javascript\u4ee3\u7801\u89e3\u6790\u6210\u62bd\u8c61\u6811\u7684\u5e93\u3002</p>\n<p>\u9996\u5148\u6211\u4eec\u9700\u8981\u5b89\u88c5\u5b83\uff1a</p>\n<p><code>npm install esprima</code></p>\n<p>\u63a5\u7740\u8c03\u7528\uff1a</p>\n<p><code>const esprima=require(\'require\'\')</code></p>\n<p>\u63a5\u4e0b\u6765\u5c31\u662f\u5206\u6790\u7684\u65f6\u5019\u4e86\u3002</p>\n<hr>\n<h3>\u4e00\u4e2a\u7b80\u5355\u7684AST\u4f8b\u5b50</h3>\n<p>\u5148\u6765\u4e2a\u7b80\u5355\u7684\u4f8b\u5b50\uff1a\n<code>function a(b){}</code></p>\n<p>\u901a\u8fc7esprima\u89e3\u6790\u540e\uff0c\u751f\u6210\u7ed3\u6784\u56fe\u5982\u4e0b\uff1a</p>\n<pre class="hljs"><code>{\n    &quot;type&quot;: &quot;Program&quot;,\n    &quot;body&quot;: [\n        {   // \u8fd9\u4e2atype\u8868\u793a\u8fd9\u662f\u4e00\u4e2a\u51fd\u6570\u8868\u8fbe\u5f0f\n            &quot;type&quot;: &quot;FunctionDeclaration&quot;,\n            &quot;id&quot;: {\n                &quot;type&quot;: &quot;Identifier&quot;,\n                &quot;name&quot;: &quot;a&quot;\n            },\n            &quot;params&quot;: [\n                {\n                    // \u53c2\u6570\u6570\u7ec4\u5185\u7684Identifier\u4ee3\u8868\u53c2\u6570\n                    &quot;type&quot;: &quot;Identifier&quot;,\n                    &quot;name&quot;: &quot;b&quot;\n                }\n            ],\n            &quot;body&quot;: {\n                &quot;type&quot;: &quot;BlockStatement&quot;,\n                &quot;body&quot;: []\n            },\n            &quot;generator&quot;: false,\n            &quot;expression&quot;: false,\n            &quot;async&quot;: false\n        }\n    ],\n    &quot;sourceType&quot;: &quot;script&quot;\n}\n</code></pre>\n<p>\u601d\u8def\uff1a</p>\n<ol>\n<li><code>FunctionDeclaration</code>\u8bf4\u660e\u662f\u4e00\u4e2a\u51fd\u6570\u8868\u8fbe\u5f0f\uff0c\u8fdb\u5165<code>params</code>\u5c5e\u6027\u3002</li>\n<li>\u5224\u65ad<code>params</code>\u4e2d\u6bcf\u4e00\u4e2a\u7684type\u662f\u5426\u4e3a<code>Identifier</code>\uff0c\u5728<code>params</code>\u5c5e\u6027\u4e0b\u7684<code>Identifier</code>\u5c31\u4ee3\u8868\u662f\u53c2\u6570\u3002</li>\n<li>\u627e\u51faname\u5c5e\u6027\u7684\u503c\uff0c\u7ed3\u679c\u4e3a<code>[\'b\']</code>\u3002</li>\n</ol>\n<p>\u6839\u636e\u4ee5\u4e0a\u601d\u8def\uff0c\u6211\u4eec\u53ef\u4ee5\u5199\u51fa\u4e00\u4e2a\u7b80\u5355\u7684\u83b7\u53d6\u53c2\u6570\u7684\u65b9\u6cd5\u4e86\u3002</p>\n<pre class="hljs"><code><span class="hljs-function"><span class="hljs-keyword">function</span> <span class="hljs-title">getParams</span>(<span class="hljs-params">fn</span>)</span>{\n  <span class="hljs-comment">// \u6b64\u5904\u5206\u6790\u7684\u4ee3\u7801\u5fc5\u987b\u662f\u5b57\u7b26\u4e32</span>\n  <span class="hljs-keyword">let</span> astEsprima=esprima.parseScript(fn.toString())\n  <span class="hljs-keyword">let</span> funcParams = []\n  <span class="hljs-keyword">let</span> node = astEsprima.body[<span class="hljs-number">0</span>]\n  <span class="hljs-comment">// \u627e\u5230type\uff0c\u8fdb\u5165params\u5c5e\u6027</span>\n  <span class="hljs-keyword">if</span> (node.type === <span class="hljs-string">"FunctionDeclaration"</span>) funcParams = node.params\n  <span class="hljs-keyword">let</span> validParam=[]\n  funcParams.forEach(<span class="hljs-function"><span class="hljs-params">obj</span>=&gt;</span>{\n    <span class="hljs-keyword">if</span>(obj.type===<span class="hljs-string">"Identifier"</span>)\n      validParam.push(obj.name)\n  })\n  <span class="hljs-keyword">return</span> validParam\n}\n</code></pre>\n<p>\u6d4b\u8bd5\u4e00\u756a\uff0c\u83b7\u53d6\u7ed3\u679c<code>[&quot;b&quot;]</code>\uff0c\u5e86\u795d\u6536\u5de5\u3002</p>\n<p>\u597d\u5427\uff0c\u522b\u9ad8\u5174\u592a\u65e9\u4e86\uff0c\u8981\u77e5\u9053\u51fd\u6570\u7684\u521b\u5efa\u65b9\u6cd5\u4e0d\u4e0b10\u79cd\uff0c\u800c\u53c2\u6570\u5199\u6cd5\u53c8\u6709\u597d\u51e0\u79cd...</p>\n<p>\u4ee5\u4e0b\u662f\u4e00\u90e8\u5206\u7684\u51fd\u6570\u521b\u5efa\u65b9\u6cd5\u548c\u53c2\u6570\u5199\u6cd5</p>\n<pre class="hljs"><code><span class="hljs-function"><span class="hljs-keyword">function</span> <span class="hljs-title">a</span>(<span class="hljs-params">x</span>)</span>{}\n\n<span class="hljs-comment">// \u6ce8\u610f\uff1a\u7b2c\u4e8c\u6761\u548c\u7b2c\u4e09\u6761\u5728AST\u4e2d\u610f\u4e49\u4e0d\u540c</span>\n<span class="hljs-keyword">let</span> a=<span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params">x=<span class="hljs-number">1</span></span>)</span>{}\n\na=<span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params">...x</span>)</span>{}\n\n<span class="hljs-keyword">let</span> a=<span class="hljs-function">(<span class="hljs-params">[x]=[<span class="hljs-number">1</span>]</span>)=&gt;</span>{}\n\n<span class="hljs-keyword">async</span> <span class="hljs-function"><span class="hljs-keyword">function</span> <span class="hljs-title">a</span>(<span class="hljs-params">x</span>)</span>{}\n\n<span class="hljs-function"><span class="hljs-keyword">function</span> *<span class="hljs-title">a</span>(<span class="hljs-params">x</span>)</span>{}\n\n<span class="hljs-class"><span class="hljs-keyword">class</span> <span class="hljs-title">a</span></span>{\n<span class="hljs-keyword">constructor</span>(x){}\n}\n\n<span class="hljs-keyword">new</span> <span class="hljs-built_in">Function</span> (<span class="hljs-string">\'x\'</span>,<span class="hljs-string">\'console.log(x)\'</span>)\n\n(<span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params"></span>)</span>{<span class="hljs-keyword">return</span> <span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params">x</span>)</span>{}})()\n\n<span class="hljs-built_in">eval</span>(<span class="hljs-string">"(function(){return function(a,b){}})()"</span>)\n</code></pre>\n<p>\u6709\u4ec0\u4e48\u60f3\u6cd5\uff1f\u5982\u679c\u4f60\u6709\u53d1\u51fa&quot;\u6211K&quot;\u7684\u60f3\u6cd5\uff0c\u90a3\u8bf4\u660e\u6211\u8fd9\u4e2a\u88c5\u903c\u8fd8\u7b97\u6210\u529f- -...</p>\n<p>\u5176\u5b9e\u53ea\u9700\u8981\u5206\u51e0\u79cd\u60c5\u51b5(\u5f88\u591a\u5199\u6cd5\u7684type\u90fd\u662f\u4e00\u81f4\u7684)\uff0c\u5c31\u53ef\u4ee5\u5b8c\u5168\u6e17\u5165\u5230\u4ee5\u4e0a\u6240\u6709\u7684\u53c2\u6570\u5bf9\u8c61\u5185\u90e8\uff0c\u518d\u8fdb\u884c\u53c2\u6570\u83b7\u53d6\u5c31\u662f\u5faa\u73af+\u5224\u65ad\u89e3\u51b3\u7684\u4e8b\u4e86\u3002</p>\n<p>\u7531\u4e8e\u7bc7\u5e45\u95ee\u9898\uff0c\u8fd9\u91cc\u4e0d\u4e00\u4e00\u5206\u6790\uff0c\u53ea\u662f\u5c06AST\u5206\u6790\u6811\u6240\u7528\u7684type\u548c\u4e00\u4e9b\u6ce8\u610f\u70b9\u3002</p>\n<h3>\u51fd\u6570\u7ed3\u6784</h3>\n<h4>\u53d8\u91cf\u58f0\u660e\u8bed\u53e5\u548c\u8868\u8fbe\u5f0f\u8bed\u53e5</h4>\n<p>\u4e0a\u9762\u6ce8\u91ca\u4e2d<code>let a=function(x=1){}</code>\u548c<code>a=function(...x){}</code>\u662f\u4e24\u79cd\u610f\u4e49\u3002</p>\n<p>\u5176\u4e2d<code>let a=function(x=1){}</code>\u6307\u7684\u662f\u53d8\u91cf\u58f0\u660e\u8bed\u53e5\uff0c</p>\n<p>\u5bf9\u5e94\u7684type\u662f<code>VariableDeclaration</code>\uff0c\u9700\u8981\u8fdb\u5165\u5b83\u7684\u521d\u59cb\u503c<code>init</code>\u5c31\u53ef\u4ee5\u83b7\u53d6\u5230\u51fd\u6570\u6240\u5728\u7684\u8bed\u6cd5\u5bf9\u8c61\uff0c\u5b83\u7684type\u662f<code>FunctionExpression</code>\u51fd\u6570\u8868\u8fbe\u5f0f\uff0c\u518d\u53bb<code>params</code>\u4e2d\u67e5\u627e\u5373\u53ef\u3002</p>\n<p>\u53d8\u91cf\u58f0\u660e\u8bed\u53e5\uff1a</p>\n<pre class="hljs"><code>\u251c\u2500\u2500VariableDeclaration....init\n        \u251c\u2500\u2500FunctionExpression.params\n</code></pre>\n<p>\u800c<code>a=function(...x){}</code>\u662f\u8868\u8fbe\u5f0f\u8bed\u53e5\uff0c</p>\n<p>\u5bf9\u5e94\u7684type\u662f<code>ExpressionStatement</code>\uff0c\u9700\u8981\u8fdb\u5165\u5b83\u7684\u8868\u8fbe\u5f0f<code>expression</code>\u83b7\u53d6\u5230\u8868\u8fbe\u5f0f\u5185\u90e8\uff0c\u8fd9\u65f6\u6211\u4eec\u8981\u8fdb\u5165\u8d4b\u503c\u8868\u8fbe\u5f0f(<code>type\u4e3aAssignmentExpression</code>)\u7684\u53f3\u8fb9(<code>right\u5c5e\u6027</code>)\uff0c\n\u83b7\u53d6\u51fd\u6570\u6240\u5728\u7684\u8bed\u6cd5\u5bf9\u8c61\uff0c\u5b83\u7684type\u540c\u6837\u4e5f\u662f<code>FunctionExpression</code>\u51fd\u6570\u8868\u8fbe\u5f0f\u3002</p>\n<p>\u8868\u8fbe\u5f0f\u8bed\u53e5\uff1a</p>\n<pre class="hljs"><code>\u251c\u2500\u2500ExpressionStatement.expression\n        \u251c\u2500\u2500AssignmentExpression.right\n                \u251c\u2500\u2500FunctionExpression.params\n</code></pre>\n<h4>class\u58f0\u660e\u548cFunction\u6784\u9020\u51fd\u6570</h4>\n<p>class\u58f0\u660e\u5bf9\u5e94\u7684type\u6709<code>ClassDeclaration</code>(class xx{...})\u6216\u8005<code>ClassExpression</code>(let x=class{...})\uff0c\u4ed6\u4eec\u4e00\u4e2a\u662f\u58f0\u660e\u4e00\u4e2a\u662f\u8868\u8fbe\u5f0f\uff0c\u5904\u7406\u65b9\u5f0f\u662f\u76f8\u540c\u7684\uff0c\n\u8fdb\u5165\u5bf9\u8c61\u5185\u90e8\uff0c\u627e\u5230kind\u4e3a<code>constructor</code>\u7684\u5bf9\u8c61\uff0c\u83b7\u53d6\u53c2\u6570\u6570\u636e\u3002</p>\n<p>class\u58f0\u660e\u8bed\u53e5\uff1a</p>\n<pre class="hljs"><code>\u251c\u2500\u2500ClassDeclaration...body...\n        \u251c\u2500\u2500{kind:constructor}\n                \u251c\u2500\u2500FunctionExpression.params\n</code></pre>\n<p>Function\u6784\u9020\u51fd\u6570\u5bf9\u5e94\u7684type\u662f<code>NewExpression</code>\u6216\u8005<code>ClassExpression</code>\uff0c\u53c2\u6570\u5728\u5c5e\u6027<code>arguments</code>\u5185\u90e8\uff0c\u4f46\u662fFunction\u7684\u53c2\u6570\u90fd\u662f\u5b57\u7b26\u4e32\uff0c\n\u800c\u4e14\u6700\u540e\u4e00\u4e2a\u53c2\u6570\u4e00\u5b9a\u662f\u51fd\u6570\u5185\u90e8\u8bed\u53e5\uff0c\u56e0\u6b64\u5bf9\u4e8eFunction\u6784\u9020\u51fd\u6570\uff0c\u5c31\u662f\u5bf9\u5b57\u7b26\u4e32\u8fdb\u884c\u5904\u7406\u3002</p>\n<p>Function\u6784\u9020\u51fd\u6570</p>\n<pre class="hljs"><code>\u251c\u2500\u2500NewExpression.arguments\n        \u251c\u2500\u2500{value:&lt;String&gt;}\n         ----&gt;\u5bf9\u5b57\u7b26\u4e32\u8fdb\u884c\u5904\u7406\uff0c\u5206\u5272\u53c2\u6570\n</code></pre>\n<h4>\u7bad\u5934\u51fd\u6570</h4>\n<p>\u7bad\u5934\u51fd\u6570type\u662f<code>ArrowFunctionExpression</code>\uff0c\u4e5f\u4ec5\u4ec5\u662f\u540d\u79f0\u4e0d\u540c\uff0c\u5185\u90e8\u7ed3\u6784\u51e0\u4e4e\u4e00\u81f4\u3002</p>\n<p>\u51fd\u6570\u7ed3\u6784\u7684type\u5c31\u5230\u6b64\u3002</p>\n<h3>\u53c2\u6570\u7ed3\u6784</h3>\n<p>\u53c2\u6570\u7684type\u6709\u4ee5\u4e0b\uff1a</p>\n<p><code>Identifier</code>\uff1a\u6700\u7ec8\u6211\u4eec\u9700\u8981\u83b7\u53d6\u7684\u53c2\u6570\u503c\u7684type</p>\n<p><code>Property</code>\uff1a\u5f53\u5b58\u5728\u89e3\u6784\u53c2\u6570\uff0c\u4f8b\u5982<code>[a,b] or {x,y}</code></p>\n<p><code>ArrayPattern</code>\uff1a\u5b58\u5728\u89e3\u6784\u53c2\u6570\u5e76\u4e14\u662f\u6570\u7ec4\uff0c\u4f8b\u5982<code>[a,b]</code></p>\n<p><code>ObjectPattern</code>\uff1a\u5b58\u5728\u89e3\u6784\u53c2\u6570\u5e76\u4e14\u662f\u5bf9\u8c61\uff0c\u4f8b\u5982<code>{x,y}</code></p>\n<p><code>RestElement</code>\uff1a\u5b58\u5728\u6269\u5c55\u8fd0\u7b97\u7b26\uff0c\u4f8b\u5982<code>(...args)</code></p>\n<p>\u6211\u4eec\u53ea\u9700\u8981\u8bbe\u7f6e\u4e00\u4e2a\u9012\u5f52\u5faa\u73af\uff0c\u601d\u8def\u548c\u4e0a\u9762\u4e00\u6837\uff0c\u4e00\u5c42\u8fdb\u5165\u53e6\u4e00\u5c42\uff0c\u5728\u5185\u90e8\u8fdb\u884c\u67e5\u627e\u3002</p>\n<h3>\u603b\u7ed3</h3>\n<p>\u7bc7\u5e45\u6709\u9650\uff0c\u5c31\u5199\u8fd9\u4e48\u591a\uff0c\u63a5\u7740\u505a\u4e00\u4e2a\u603b\u7ed3\u3002</p>\n<p>\u8fd9\u7bc7\u8bb2\u7684\u4e3b\u65e8\u53ea\u67091\u4e2a\uff0c\u901a\u8fc7\u5bf9AST\u6811\u4e2d\u6bcf\u4e00\u4e2a\u5bf9\u8c61\u7684type\u5206\u6790\uff0ctype\u8868\u793a\u7684\u662f\u5bf9\u5e94\u7684\u4ee3\u7801\u7684\u610f\u4e49\uff0c\u4e5f\u662f\u4ee3\u7801\u7684\u8bed\u4e49\uff0c\u4f8b\u5982</p>\n<p><code>VariableDeclaration</code>\u5185\u90e8\u4e00\u5b9a\u4f1a\u6709<code>init</code>\uff0c\u4e3a\u4ec0\u4e48\uff0c\u56e0\u4e3a\u53d8\u91cf\u58f0\u660e\u662f\u6709\u521d\u59cb\u503c\u7684\uff0c\u5982\u679c\u4f60\u4e0d\u8bbe\u7f6e\uff0c\u90a3\u4e48\u5c31\u4e3a<code>undefined</code></p>\n<p>type\u8fdc\u4e0d\u6b62\u8fd9\u6b21\u8bf4\u7684\u8fd9\u4e48\u591a\uff0c\u5b98\u7f51(\u6216\u8005Google)\u4e0a\u6709\u8be6\u7ec6\u4ecb\u7ecd\u3002</p>\n<hr>\n<h3>\u6700\u540e</h3>\n<p><a href="https://github.com/stonehank/get-function-params-with-ast"><code>AST\u83b7\u53d6\u51fd\u6570\u53c2\u6570</code>\u6e90\u4ee3\u7801\u5728\u6b64</a>\u3002</p>\n<p>\u5982\u679c\u672c\u6587\u5bf9\u4f60\u6709\u6240\u5e2e\u52a9\uff0c\u6b22\u8fceSTAR\uff0c\u6216\u8005\u4f60\u5bf9\u6b64\u6709\u4ec0\u4e48\u66f4\u597d\u7684\u60f3\u6cd5\uff0c\u6b22\u8fce\u7559\u8a00\uff01</p>\n<p>\u6700\u91cd\u8981\u5982\u679c\u53d1\u73b0\u4e86BUG\u6216\u8005\u6f0f\u5339\u914d\uff0c\u8bf7\u4e00\u5b9a\u8981\u544a\u77e5(Issue/PR/\u7559\u8a00)\uff0c\u611f\u6fc0\u4e0d\u5c3d\uff01</p>\n'}}}]);
